+TextReplacements=(Category=Game, Namespace="AmpleHammer", Key="SettingDescription", NativeString="TBD", LocalizedStrings=(("ar","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">تشغيل</>: يمكن لطفلك التفاعل مع ميزات الذكاء الصناعي في منتجات Epic Games من خلال التواصل الصوتي والنصي. ويتضمن ذلك التفاعل مع شخصية ذكاء صناعي تحاوري غير قابلة للعب في Fotnite.\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">إيقاف</>: لا يمكن لطفلك التفاعل مع ميزات الذكاء الصناعي في منتجات Epic Games من خلال التواصل الصوتي والنصي.\n\nملاحظة: لا ينطبق ذلك على عمليات التفاعل مع دعم اللاعبين المزود بخاصية الذكاء الصناعي."),("en","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">ON</>: Your child can interact with AI features in Epic Games products through voice and written communication. This includes interacting with conversational AI non-playable characters in Fortnite\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">OFF</>: Your child cannot interact with AI features in Epic Games' products through voice and written communication.\n\nNote: This control does not apply to AI-powered player support interactions."),("de","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">AN</>: Ihr Kind kann mit den KI-Funktionen in Produkten von Epic Games durch schriftliche und verbale Kommunikation interagieren. Dies beinhaltet die Interaktion mit konversationeller KI von nichtspielbaren Charakteren in Fortnite\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">AUS</>: Ihr Kind kann nicht mit den KI-Funktionen der Produkte von Epic Games durch schriftliche und verbale Kommunikation interagieren.\n\nHinweis: Diese Einstellung betrifft nicht die KI-gesteuerten Spielerunterstützungsinteraktionen."),("es","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">SÍ</>: el menor puede usar el chat de voz y texto para interactuar con las funciones de IA en los productos de Epic Games. Esto incluye la interacción con personajes no jugables con IA conversacional en Fortnite\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">NO</>: el menor no puede usar el chat de voz y texto para interactuar con las funciones de IA en los productos de Epic Games.\n\nNota: este control no afecta a las interacciones de asistencia al jugador que funcionan con IA."),("es-419","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">HABILITADO</>: Tu hijo/a puede usar el chat de voz y texto para interactuar con la IA conversacional en productos de Epic Games. Esto incluye interactuar con personajes no jugables con IA conversacional en Fortnite.\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">DESHABILITADO</>: Tu hijo/a no puede interactuar con funciones de IA en productos de Epic Games a través del chat de voz y texto.\n\nNota: Este control no aplica para interacciones de asistencia al jugador potenciadas por IA."),("fr","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">OUI</> : Votre enfant peut interagir de manière vocale et textuelle avec les fonctionnalités d'IA présentes dans les produits Epic Games, y compris les personnages non-joueurs qui fonctionnent grâce à une IA conversationnelle dans Fortnite.\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">NON</> : Votre enfant ne peut pas interagir de manière vocale et textuelle avec les fonctionnalités d'IA présentes dans les produits Epic Games.\n\nRemarque : ceci ne s'applique pas aux fonctionnalités d'IA du système d'assistance aux joueurs."),("it","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">Sì</>: Il tuo minore può interagire con le funzionalità che sfruttano l'IA nei prodotti di Epic Games tramite la comunicazione vocale e scritta. Ciò include comunicare con personaggi non giocanti con IA conversazionale integrata su Fortnite.\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">NO</>: Il tuo minore non può interagire con le funzionalità che sfruttano l'IA nei prodotti di Epic Games tramite la comunicazione vocale e scritta.\n\nNota: questa impostazione non si applica alle interazioni con l'assistenza giocatori che si servono dell'IA."),("ja","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">オン</>: お子様はEpic Games製品内のAI機能とボイスおよびテキストでのコミュニケーションを通してインタラクトできます。これはフォートナイトで会話AIの非プレイヤーキャラクターに話しかけれることを含みます。\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">オフ</>: お子様はEpic Games製品内のAI機能とボイスおよびテキストでのコミュニケーションを通してインタラクトできません。\n\n注: このコントロールはAIを活用したプレイヤーサポートには適用されません。"),("ko","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">켜기</>: 자녀는 에픽게임즈 제품에서 음성과 문자로 AI 기능과 상호작용할 수 있습니다. 여기에는 포트나이트 내의 대화형 AI NPC(플레이 불가능한 캐릭터)와의 상호작용도 포함됩니다.\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">끄기</>: 자녀는 에픽게임즈 제품에서 음성과 문자로 AI 기능과 상호작용할 수 없습니다.\n\n참고: 이 설정은 AI 기반 지원센터 기능에는 적용되지 않습니다."),("pl","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">WŁ.</>: Twoje dziecko może wchodzić w interakcję z funkcjami SI w produktach Epic Games poprzez komunikację głosową i pisemną. Obejmuje to rozmowy z korzystającymi z SI postaciami niezależnymi.\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">WYŁ.</>: Twoje dziecko nie może wchodzić w interakcję z funkcjami SI w produktach Epic Games poprzez komunikację głosową i pisemną.\n\nUwaga: Nie dotyczy interakcji z pomocą techniczną wspomaganą przez SI."),("pt-BR","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">HABILITADO</>: sua criança pode interagir com os Recursos de IA presentes nos produtos da Epic Games por meio da comunicação por voz e texto. Isto inclui interagir com a IA de Conversação presente em personagens não-jogáveis dentro do Fortnite.\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">DESABILITADO</>: sua criança não pode interagir com os Recursos de IA presentes nos produtos da Epic Games por meio da comunicação por voz e texto. Este controle não se aplica às interações com o suporte ao jogador que contém tecnologia de IA."),("ru","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">Вкл.</>: ваш ребёнок может взаимодействовать с ИИ-функциями в продуктах Epic Games посредством голосового и письменного общения. Такое взаимодействие включает в себя общение с неигровыми персонажами — ИИ-собеседниками — в Fortnite.\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">Откл.</>: ваш ребёнок не может взаимодействовать с ИИ-функциями в продуктах Epic Games посредством голосового и письменного общения.\n\nПримечание: этот параметр не распространяется на взаимодействие со службой поддержки игроков, использующей ИИ."),("tr","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">AÇIK</>: Çocuğunuz sesli ve yazılı iletişim yoluyla Epic Games ürünlerindeki Yapay Zekâ özellikleriyle etkileşime girebilir. Buna Fortnite'taki oyuncu olmayan, konuşmaya dayalı Yapay Zekâ karakterleriyle etkileşim de dahildir\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">KAPALI</>: Çocuğunuz sesli ve yazılı iletişim yoluyla Epic Games ürünlerindeki yapay zeka özellikleriyle etkileşime giremez.\n\nNot: Bu kontrol yapay zeka destekli oyuncu desteği etkileşimleri için geçerli değildir."),("zh-hans","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">开启</>: 您的孩子可以通过语音及文字与Epic Games产品中的AI功能交流。这包括在Fortnite中与对话式AI NPC互动。\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">关闭</>: 您的孩子无法通过语音及文字与Epic Games产品中的AI功能交流。\n\n注意：此设置不适用于AI驱动的玩家支持交流。"),("zh-Hant","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">開啟</>：你的孩子能在 Epic Games 產品中與 AI 功能進行語音和文字交流互動。這包括了與 Fortnite 中的對話式 AI NPC 進行互動。\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">關閉</>：你的孩子無法與 Epic Games 產品中的 AI 功能進行語音和文字交流互動。\n\n注意：該設置不適用於 AI 驅動的玩家支援互動。"),("id","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">AKTIF</>: Putra-putri Anda dapat berinteraksi dengan fitur AI pada produk-produk Epic Games melalui komunikasi tertulis dan verbal. Ini termasuk berinteraksi dengan karakter AI yang tak dapat dimainkan namun dapat berbincang di Fortnite\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">NONAKTIF</>: Putra-putri Anda tak dapat berinteraksi dengan fitur AI pada produk-produk Epic Games melalui komunikasi tertulis dan verbal.\n\nCatatan: Kontrol ini tidak termasuk untuk interaksi dukungan pemain berbasis AI."),("th","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">เปิด</>: บุตรหลานของคุณจะสามารถโต้ตอบกับฟีเจอร์ AI ในผลิตภัณฑ์ต่างๆ ของ Epic Games ได้ด้วยการพูดคุยผ่านเสียงและข้อความ ซึ่งจะรวมถึงการโต้ตอบกับ AI คู่สนทนาที่เป็นตัวละครในเกม Fortnite ด้วย\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">ปิด</>: บุตรหลานของคุณจะไม่สามารถโต้ตอบกับฟีเจอร์ AI ในผลิตภัณฑ์ต่างๆ ของ Epic Games ด้วยการพูดคุยผ่านเสียงและข้อความ\n\nหมายเหตุ: การควบคุมในส่วนนี้จะไม่ครอบคลุมการโต้ตอบกับบริการช่วยเหลือผู้เล่นที่ใช้เทคโนโลยี AI"),("vi","<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">BẬT</>: Con bạn có thể tương tác với những tính năng AI trong các sản phẩm của Epic Games thông qua giao tiếp bằng giọng nói và văn bản, trong đó bao gồm hoạt động tương tác với các nhân vật AI không phải người chơi trong Fortnite\n\n<text color=\"00FFD6FF\" fontface=\"black\" case=\"upper\" size=\"20\">TẮT</>: Con bạn sẽ không tương tác được với những tính năng AI trong các sản phẩm của Epic Games thông qua giao tiếp bằng giọng nói và văn bản.\n\nLưu ý: Chế độ kiểm soát này không áp dụng cho các hoạt động tương tác của AI nhằm hỗ trợ người chơi.")))
