+TextReplacements=(Category=Game, Namespace="", Key="78C7519949FFC6CD2789F28099841D38", NativeString="Thank you for your bug report on AI Speech.", LocalizedStrings=(("ar","شكرًا لك على الإبلاغ عن مشكلة بخصوص التفاعل مع شخصية ذكاء صناعي غير قابلة للعب."),("en","Thanks for submitting your bug report on AI NPC Interaction."),("de","Danke, dass du einen Fehler zur KI-NPC-Interaktion gemeldet hast."),("es","Gracias por informarnos de este error relacionado con una interacción de NPC con IA."),("es-419","Gracias por informarnos de este error relacionado con una interacción de NPC con IA."),("fr","Merci d'avoir signalé ce bug concernant une interaction avec un PNJ fonctionnant avec l'IA."),("it","Grazie per aver segnalato un bug sul dialogo con l'IA."),("ja","AIのNPCインタラクションに関する不具合を報告していただきありがとうございます。"),("ko","AI NPC 상호작용 버그를 신고해 주셔서 감사합니다."),("pl","Dziękujemy za zgłoszenie błędu dotyczącego interakcji z postacią niezależną SI."),("pt-BR","Agradecemos por enviar seu relatório de erro sobre Interação de PNJ com IA."),("ru","Благодарим вас за сообщение об ошибке взаимодействия с ИИ-персонажем."),("tr","Yapay Zekâ Karakter Etkileşimiyle ilgili hata raporunu gönderdiğin için teşekkür ederiz."),("zh-hans","感谢你为AI NPC互动提交报错报告"),("zh-Hant","感謝你為 AI NPC 互動通報錯誤"),("id","Terima kasih atas laporan bug Anda untuk Interaksi NPC AI."),("th","ขอขอบคุณที่รายงานบั๊กเกี่ยวกับการโต้ตอบของ AI NPC"),("vi","Cảm ơn bạn đã báo lỗi về Hoạt Động Tương Tác Với Nhân Vật NPC AI.")))
+TextReplacements=(Category=Game, Namespace="", Key="CAF746EC4C12862D3930F88B2D911578", NativeString="You are about to submit a bug for: AI Speech. A log of recent responses you have received from AI will be provided to Epic Games for review.", LocalizedStrings=(("ar","أنت على وشك إرسال مشكلة بخصوص: التفاعل مع شخصية ذكاء صناعي غير قابلة للعب. سيتم مشاركة سجل آخر تفاعلات تمت من جانب الذكاء الصناعي مع Epic Games لمراجعتها."),("en","You are about to submit a bug for: AI NPC Interaction. A log of recent AI-generated interactions you have experienced will be provided to Epic Games for review."),("de","Du bist im Begriff, einen Fehler zu folgendem Thema zu melden: KI-NPC-Interaktion. Ein Protokoll der letzten von dir ausgeführten KI-generierten Interaktionen wird Epic Games zur Prüfung bereitgestellt."),("es","Estás a punto de enviar un informe de error relacionado con una interacción de NPC con IA. Se proporcionará a Epic Games un registro de las respuestas más recientes que hayas recibido de la IA para su estudio."),("es-419","Estás a punto de enviar un informe de error relacionado con una interacción de NPC con IA. Se proporcionará a Epic Games un registro de las respuestas más recientes que hayas recibido de la IA para su estudio."),("fr","Vous vous apprêtez à signaler un bug relatif à ceci : interaction avec un PNJ utilisant l'IA. Un historique de vos dernières interactions avec l'IA va être transmis à Epic Games afin qu'elles puissent être analysées."),("it","Stai per inviare un bug per: Dialogo con l'IA. Epic Games riceverà un resoconto delle risposte più recenti che l'IA ti ha dato da esaminare."),("ja","次の不具合を送信しようとしています: AIのNPCインタラクション。あなたが経験した、AIによるインタラクションの最近のログは、審査のためにEpic Gamesに提供されます。"),("ko","AI NPC 상호작용 버그를 신고하려고 합니다. 최근 경험한 AI 기반 상호작용 로그가 검토를 위해 에픽게임즈에 제공됩니다."),("pl","Zgłaszasz błąd dla: Interakcja z postacią niezależną SI. Epic Games otrzyma do wglądu twój rejestr ostatnich interakcji generowanych przez SI."),("pt-BR","Você está prestes a relatar o seguinte erro: interação de PNJ com IA. A Epic Games receberá um relatório com as interações recentes com a IA para analisar o caso. "),("ru","Вы собираетесь отправить сообщение об ошибке взаимодействия с ИИ-персонажем. История недавних взаимодействий с ИИ-персонажами будет передана Epic Games для рассмотрения."),("tr","Şunun için bir hata raporu göndermek üzeresin: Yapay Zekâ Karakter Etkileşimi. Deneyimlediğin son Yapay Zekâ etkileşimlerinin kaydı incelenmek üzere Epic Games'e gönderilecek."),("zh-hans","你即将为以下功能提交报错报告：AI NPC互动。近期你收到的由AI生成的互动记录将被发送给Epic Games审阅。"),("zh-Hant","你即將提交錯誤通報：AI NPC 互動。你近期從 AI 收到的回應紀錄將會提供給 Epic Games 進行審查。"),("id","Anda akan mengirimkan laporan bug untuk: Interaksi NPC AI. Riwayat dari interaksi AI yang Anda dapatkan baru-baru ini akan diberikan kepada Epic Games untuk ditinjau."),("th","คุณกำลังจะส่งเรื่องบั๊กเกี่ยวกับ: การโต้ตอบของ AI NPC ระบบจะส่งรายการบันทึกการโต้ตอบของคุณกับ AI \n\nเมื่อเร็วๆ นี้ให้ Epic Games ดำเนินการตรวจสอบ"),("vi","Bạn sắp gửi một lỗi về: Hoạt Động Tương Tác Với Nhân Vật NPC AI. Bản ghi tập hợp các nội dung do AI tạo ra khi tương tác với bạn sẽ được cung cấp cho Epic Games để xem xét.")))
+TextReplacements=(Category=Game, Namespace="", Key="3D1F501141108B190963C9ABDD3FDB29", NativeString="ALERT! Slurp Leviathan has escaped Brick Bay’s super-secret agency, The Bureau! We’ve hired Noir to hit the streets and look for clues…  <b>Slurp Leviathan and Noir's voice reactions are powered by AI.</>", LocalizedStrings=(("ar","تنبيه! هرب الشراب لوياثان من وكالة خليج المكعبات فائقة السرية، اللجنة! لقد جندنا إجرامي ليجوب الشوارع بحثا عن أدلة....‎\n\n<b>‎الردود الصوتية للشراب لوياثان وإجرامي مدعومة بالذكاء الصناعي. يمكن الإبلاغ عن المشكلات عن طريق طي قائمة أعضاء الفريق في قائمة الشريط الجانبي داخل اللعبة، والذهاب إلى إبلاغ، والإبلاع عن مشكلة.</>"),("en","ALERT! Slurp Leviathan has escaped Brick Bay’s super-secret agency, The Bureau! We’ve hired Noir to hit the streets and look for clues….\n\n<b>Slurp Leviathan and Noir’s commentary is powered by AI. You can report bugs with it by collapsing your Team Members list in the sidebar menu in-game, and going to reporting, then report a bug.</> "),("de","ACHTUNG! Schlürf-Leviathan ist aus Steinbuchts supergeheimer Agentur „The Bureau“ entkommen! Wir haben Noir angeheuert, um auf den Straßen nach Hinweisen zu suchen ...\n\n<b>Schlürf-Leviathans und Noirs Stimmreaktionen werden von einer KI bereitgestellt. Ihr könnt Bugs damit melden, indem ihr die Liste eurer Teammitglieder in der Seitenleiste im Spiel einklappt und dann auf „Melden“ geht und einen Bug meldet.</>"),("es","¡ALERTA! Leviatán Sorbete se ha escapado de El Buró, la agencia supersecreta de Litoral Ladrillo. Hemos contratado a Noir para barrer las calles en busca de pistas.\n\n<b>Las reacciones de voz de Leviatán Sorbete y Noir están hechas con IA. Para informarnos de cualquier error, minimiza la lista de miembros de tu equipo en el menú lateral del juego y ve a Informe de errores.</>"),("es-419","¡ALERTA! Leviatán sorbo se escapó de El Buró, la agencia supersecreta de Litoral Ladrillo. Contratamos a Noir para investigar por la ciudad en busca de pistas... \n\n<b>Las reacciones de voz de Leviatán sorbo y Noir están hechas con IA. Para informarnos de cualquier error, minimiza la lista de miembros de tu equipo en el menú lateral del juego y ve a Informe de errores.</>"),("fr","ALERTE ! Le Léviathan du bleuvage s'est échappé du Bureau, l'agence super secrète de Briquopolis. Nous avons engagé le Limier noir pour écumer les rues et trouver des indices... \n\n<b>Les réponses du Léviathan du bleuvage et du Limier noir fonctionnent avec l'IA. Vous pouvez signaler les problèmes rencontrés en vous rendant dans la liste des membres de l'équipe depuis le menu, puis en allant dans la section signalement et signaler un bug.</>"),("it","ATTENZIONE! Leviatano Succoso è fuggito dall'agenzia super segreta di Baia Blocchetto, il Bureau! Abbiamo incaricato Noir di setacciare le strade a caccia di indizi… \n\n<b>Le voci di Leviatano Succoso e Noir sono generate dall'IA. Puoi segnalare eventuali bug nascondendo la lista Membri della squadra nel menu della barra laterale di gioco, selezionando Segnalazione e completando il procedimento.</>"),("ja","警告！ スラープリヴァイアサンがブロック・ベイの極秘機関である捜査局から逃亡した！ 我々はノワールを雇い、街で手がかりを追っている…\n\n<b>スラープリヴァイアサンとノワールの応答にはAIが使用されています。ゲーム内のサイドバーメニューでチームメンバーリストを折りたたんでから、「通報」→「不具合を通報する」の順に進むと、この不具合を報告できます。</> "),("ko","경계를 늦추지 마세요! 홀짝주스 레비아단이 브릭 베이의 비밀 기관인 정보국을 탈출했습니다! 누와르가 거리로 나가 단서를 찾고 있습니다. \n\n<b>홀짝주스 레비아단과 누와르의 반응은 AI로 구현됩니다. 게임 내 사이드바 메뉴에서 친구 목록을 접은 후 신고 메뉴에서 버그를 신고할 수 있습니다.</>"),("pl","UWAGA! Siorb-Lewiatan uciekł Agencji – supertajnej organizacji Klockowej Przystani! Do przeczesania ulic w poszukiwaniu wskazówek wynajęliśmy Noira....\n\n<b>Komentarze Siorb-Lewiatana i Noira są zasilane przez SI. Aby zgłosić błędy SI w grze, należy otworzyć pasek boczny z listą członków drużyny, przejść do opcji Zgłaszanie, a następnie kliknąć przycisk Zgłoś błąd.</>"),("pt-BR","ALERTA! O Leviatã Glup escapou da agência secreta da Baía dos Blocos! Contratamos o Noir para investigar as pistas nas ruas....\n\n<b>Os comentários de Leviatã Glup e Noir foram criados com IA. Para reportar falhas, minimize a lista de Membros da Equipe no menu da Barra Lateral, onde verá o recurso para poder enviar seu relatório de erro.</>"),("ru","ТРЕВОГА! Нектарный Левиафан совершил побег из Бюро — сверхсекретного агентства в Городе кубиков. Поэтому мы поручили Нуару отправиться на поиски улик... \n\n<b>Нектарный Левиафан и Нуар озвучены ИИ. Чтобы сообщить об ошибке, откройте боковое меню в игре, сверните список членов команды и перейдите в раздел жалоб.</>"),("tr","DİKKAT! Mavi Gazoz Akvaryum Kafa, Yapı Koyu'nun süper gizli servisi Büro'dan kaçtı! Sokakları gezip ipuçları araması için Belalı Hafiye'yi görevlendirdik….\n\n<b>Mavi Gazoz Akvaryum Kafa ve Belalı Hafiye'nin yorumları Yapay Zekâ tarafından oluşturulur. Bunlarla ilgili hataları oyun içinde yan menüde bulunan Takım Üyeleri listesini küçültüp raporlamaya giderek ve bir hata raporu göndererek rapor edebilirsin.</>"),("zh-hans","注意！果汁利维坦已经从积木湾的绝密机构特工局潜逃！我们聘请了黑衣侠探巡街调查……\n\n<b>果汁利维坦和黑衣侠探的回应由AI支持。如需报错，可以在游戏内侧边栏菜单中收起小队成员列表，选择举报/反馈，然后进行报错。</>"),("zh-Hant","注意！吸樂補利維坦從積木灣的超機密機構「The Bureau」脫逃了！我們已經派出黑衣警探去尋找線索了……\n\n<b>吸樂補利維坦和黑衣警探的語音回應均由對話式 AI 驅動。如要就對話舉報錯誤，你可在遊戲中的側邊欄選單中收起組隊成員列表，然後前往舉報，即可舉報錯誤。 </>"),("id","PERINGATAN! Slurp Leviathan telah melarikan diri dari agensi super-rahasia Brick Bay, The Bureau! Kami telah merekrut Noir untuk turun ke lapangan dan mencari petunjuk....\n\n<b>Komentar Leviathan dan Noir dihasilkan dengan teknologi AI. Kamu dapat melaporkan bug dengan melihat daftar Anggota Tim melalui menu bilah samping dalam game, lalu bagian melaporkan, lalu laporkan bug.</>"),("th","ระวัง! เลวีอาธาน สเลิร์ปได้หลบหนีไปจากบิวโร หน่วยงานลับสุดยอด\nของบริกเบย์! เราได้จ้างให้นัวร์ออกไปตามล่าหาเบาะแสแล้ว…\n\n<b>คำพูดของเลวีอาธาน สเลิร์ปและนัวร์เกิดจากเทคโนโลยี AI คุณสามารถรายงานบั๊ก</>\n<b>ด้วยการยุบรายชื่อสมาชิกในทีมตรงเมนูแถบด้านข้างในเกม จากนั้นเข้าไปที่การรายงานแล้วรายงานบั๊ก</>"),("vi","BÁO ĐỘNG! Thủy Quái Lam Thể đã trốn thoát khỏi Cục Thám Báo, cơ quan siêu tối mật của Vịnh Lắp Ráp! Chúng tôi đã thuê Noir đi khắp các con phố để truy tìm manh mối… \n\n<b>Lời bình luận của Thủy Quái Lam Thể và Noir là do AI tạo ra. Bạn có thể báo lỗi về nội dung này bằng cách thu gọn danh sách Thành Viên Đội trong menu thanh bên trong trò chơi, rồi vào phần báo cáo, sau đó thực hiện báo lỗi.</>")))
