+TextReplacements=(Category=Game, Namespace="", Key="8AC1FD004AB94EB4288F32BE93C5BD89", NativeString="The Battle Bundle includes <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} BATTLE PASS REWARDS</> at a discount rate!", LocalizedStrings=(("ar","تشمل حزمة المعركة سوبرمان <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} مكافآت بطاقة المعركة</> بمبلغ مخفض للحزمة وتفتح سوبرمان مبكرًا!"),("en","The Superman Battle Bundle includes <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} BATTLE PASS REWARDS</> at a reduced bundle rate and unlocks Superman early!"),("de","Das Superman Battle Pass-Paket inkludiert <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} BATTLE PASS-BELOHNUNGEN</> zu einem reduzierten Paketpreis und schaltet Superman frühzeitg frei!"),("es","¡El lote de batalla de Superman incluye <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} recompensas del pase de batalla</> a un precio reducido y te permite desbloquear a Superman antes!"),("es-419","¡El paquete de batalla de Superman incluye <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} RECOMPENSAS DEL PASE DE BATALLA</> a un precio reducido y te permite desbloquear a Superman antes!"),("fr","Le Pack de combat Superman comprend <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} récompenses du Passe de combat</> à prix réduit et permet de déverrouiller Superman en avance !"),("id","Battle Bundle Superman termasuk <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} HADIAH BATTLE PASS</> dengan harga yang lebih terjangkau serta dapat membuka Superman lebih awal!"),("it","Il Bundle battaglia Superman include <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} RICOMPENSE PASS BATTAGLIA</> a tariffa ridotta, e ti fa sbloccare in anticipo Superman!"),("ja","スーパーマンバトルバンドルには<text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} バトルパス報酬</>が割引されたバンドル価格で入っており、加えて「スーパーマン」をいち早くアンロックできる！"),("ko","슈퍼맨 배틀 번들은 <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant}개의 배틀패스 보상</>을 포함하고 있습니다. 번들을 할인가에 구매하고 슈퍼맨을 미리 잠금 해제하세요!"),("pl","Zestaw Bojowy Supermana zawiera następującą liczbę nagród w obniżonej cenie: <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant}</> i pozwala na wcześniejsze odblokowanie Supermana!"),("pt-BR","O Pacotão de Batalha Superman inclui <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} RECOMPENSAS DO PASSE DE BATALHA</> por um preço reduzido e desbloqueia o Superman antecipadamente!"),("ru","Боевой набор Супермена включает <text color=\"FFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} НАГРАДЫ БОЕВОГО ПРОПУСКА</> по сниженной цене и ранний доступ к Супермену!"),("th","บันเดิลแบทเทิลซูเปอร์แมนมาพร้อม<text color=\"FFFFFFFF\" fontface=\"75 Medium\">รางวัลแบทเทิลพาส {GetLevelsToGrant} รายการ</> เป็นเจ้าของบันเดิลในราคาพิเศษเพื่อปลดล็อกซูเปอร์แมนก่อนใคร!"),("tr","Superman Savaş Paketi, paket indirimli fiyatıyla <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} SAVAŞ BİLETİ ÖDÜLLERİNİ</> içerir ve Superman'i erkenden açar!"),("vi","Bộ Quà Chiến Đấu Siêu Nhân đã bao gồm <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} PHẦN THƯỞNG TRONG THẺ CHIẾN ĐẤU</>. Hưởng mức giá ưu đãi khi mua cả bộ quà và có cơ hội mở khóa sớm Siêu Nhân!"),("zh-hans","英雄崛起同捆包可以以优惠价获得<text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant}个战斗通行证奖励</>，还可以提前解锁超人！"),("zh-Hant","超人戰鬥組合包包含 <text color=\"FFFFFFFF\" fontface=\"75 Medium\">{GetLevelsToGrant} 個戰鬥通行證獎勵</>，享受組合包優惠價格，提前解鎖超人！")))
