+TextReplacements=(Category=Game, Namespace="", Key="94146F924738EC23A44B9AAE37FA8DEC", NativeString="Comes with napa cabbage but Louise added wings.", LocalizedStrings=(("ar","زار بوب في حُلم."),("en","It came to Bob in a dream."),("de","Er erschien Bob im Traum."),("es","Se le apareció a Bob en un sueño."),("es-419","Se le apareció a Bob en un sueño."),("fr","Il est apparu en rêve à Bob."),("id","Ia menemui Bob dalam mimpi."),("it","È apparso a Bob in sogno."),("ja","ボブが夢の中で思いついた。"),("ko","밥의 꿈속에 찾아왔습니다."),("pl","Nawiedził Boba w snach."),("pt-BR","Apareceu num sonho do Bob."),("ru","Он явился Бобу во сне."),("th","บ็อบฝันเห็นสิ่งนี้"),("tr","Bob'a rüyasında görünen hamburger."),("vi","Xuất hiện trong giấc mơ của Bob."),("zh-hans","从鲍勃梦中得来的灵感。"),("zh-Hant","Bob 在夢中看到的。")))
